var maximumHappinessSum = function (happiness, k) {
    happiness.sort((a, b) => b - a);
    let children = happiness.slice(0, k);
    let maximumSum = 0;
    children.forEach((v, i) => {
        maximumSum += v - i >= 0 ? v - i : 0;
    });
    return maximumSum;
}

